import React from "react"

const ContentContainer = () => {
    const headerStyle = {
      padding: "20px 0",
      lineHeight: "1.5em",
    }

return (
    <header style={headerStyle}>
      <h1
        style={{
          fontSize: "6rem",
          fontWeight: "600",
          marginBottom: "2rem",
          lineHeight: "1em",
          color: "#ececec",
          textTransform: "lowercase",
          textAlign: "center",
          backround
        }}
      >
        todos
      </h1>
    </header>
  )
}

export default ContentContainer
